import React from 'react';
import logo from './logo.svg';
import './App.css';
import Categoria from './components/Categoria';
import 'tailwindcss/tailwind.css';

function App() {
  return (
    <div className="flex-1">
      <Categoria nombre="Matematica" descripcion='analisis matematico' tareas={["hola", "como", "va"]}/>
      <Categoria nombre="Bases de Datos"/>
      <Categoria nombre="Redes"/>
      <Categoria nombre="Arqui de Software"/>
      <Categoria nombre="Arqui de Software 2"/>

    </div>
  );
}

export default App;
